/* -- slider tablet -- */

.swiper-container {
  position:relative;
  width: 90vw;
  height: 300px;
}

.swiper-container > .swiper-slide__content {
  position:absolute;
  top:0;
}

.swiper-slide {
  display:flex;
  align-items: center;
  justify-content:center;
  transition:all 200ms linear;
  transform: scale(0.8);
  &.swiper-slide-active{
    transform: scale(1);
  }
}

.swiper-slide__content {
  height: 300px;
}

.swiper-slide-next {
  opacity: 0.4;
}

.swiper-slide-prev {
  opacity: 0.4;
}

/* animation scroll */

.reveal {
  position: relative;
  opacity: 0;
}

.reveal.active {
  opacity: 1;
}

.active.fade-bottom {
  animation: fade-bottom 0.8s ease-out;
}

.active.fade-left {
  animation: fade-left 1s ease-in;
}

.active.fade-right {
  animation: fade-right 1s ease-in;
}

@keyframes fade-bottom {
  0% {
    transform: translateY(50px);
    opacity: 0;
  }

  100% {
    transform: translateY(0);
    opacity: 1;
  }
}

@keyframes fade-left {
  0% {
    transform: translateX(-100px);
    opacity: 0;
  }

  100% {
    transform: translateX(0);
    opacity: 1;
  }
}

@keyframes fade-right {
  0% {
    transform: translateX(100px);
    opacity: 0;
  }

  100% {
    transform: translateX(0);
    opacity: 1;
  }
}

main {
  overflow-x:hidden;
}

